import React from 'react'
import { Form } from "react-bootstrap";


function Service() {

  return (
    <Form>
      <Form className="Group"></Form>
       <Form.Label className="sr-only">Service</Form.Label>
      <Form.Control as="select">
        <option>1</option>
        <option>2</option>
      </Form.Control>
    </Form>
    );
}

export default Service;
